import React, { useContext } from 'react';
import { NavLink } from "react-router-dom";
import authService, {AuthContext} from "../services/auth"; 
import { GiExitDoor } from 'react-icons/gi';



function Nav(props) {
    const hidden = () =>{
        const menu = document.querySelector('#navbarSupportedContent');
        menu.classList.toggle('collapse')
    }
    const authData = useContext(AuthContext);

    const handleLogout = () => {
        authService
            .logout()
            .then(rta => {
                if(rta) {
                    authData.updateAuthData({
                        id_usuario: null,
                        id_rol: null,
                        email: null,
                    });
                    if(typeof props.notExitosa === "function") {
                        props.notExitosa({
                            ...rta.data
                        });
                    }
                }
            })
            .catch(e => console.log('Error: ', e));
    };

    return (<nav 
    className="navbar navbar-expand-lg navbar-light bg-warning">

        <a className="navbar-brand" href="#">Andiamo</a>
        <button className="navbar-toggler" 
        type="button" 
        data-toggle="collapse" 
        data-target="#navbarSupportedContent"
        aria-controls="navbarSupportedContent"
        aria-expanded="false" 
        aria-label="Toggle navigation"
        onClick={hidden}>
            
            <span className="navbar-toggler-icon"></span>
        </button>
        
        <div className="collapse navbar-collapse hamburguesa navs" id="navbarSupportedContent" >
            <ul className="navbar-nav mr-auto navegador ">
                <li className="nav-item">
                    <NavLink className="nav-link letras" activeClassName="active" to="/" exact>Home</NavLink>
                </li>

                {
                     authData.user.id_rol == 2  || authData.user.id_rol == 1 ? 
                        (<>
                           <li className="nav-item">
                                <NavLink className="nav-link letras" activeClassName="active" to="/viajes">Panel de viajes</NavLink>
                            </li>
                        </>) :
                         (<>
                          
                        </>)
                      
                }

               <li className="nav-item">
                    <NavLink className="nav-link letras" activeClassName="active" to="/viajesusuarios">Viajes</NavLink>
                </li>

                {
                    authData.user.id_rol == 1 ? 
                        (<>
                           <li className="nav-item">
                                <NavLink className="nav-link letras" activeClassName="active" to="/empresas">Panel de empresas</NavLink>
                            </li>
                        </>) :
                         (<>
                          
                        </>)
                      
                }

                <li className="nav-item">
                    <NavLink className="nav-link letras" activeClassName="active" to="/empresasusuarios"> Empresas</NavLink>
                </li>

                {
                    authData.user.id_rol == 3 ? 
                        (<>
                <li className="nav-item">
                    <NavLink className="nav-link letras" activeClassName="active" to="/perfil"> Perfil</NavLink>
                </li>
                </>) :
                         (<>
                          
                        </>)
                      
                }

{
                    authData.user.id_rol == 2 ? 
                        (<>
                <li className="nav-item">
                    <NavLink className="nav-link letras" activeClassName="active" to="/perfilempresa"> Perfil empresa</NavLink>
                </li>
                
                </>) :
                         (<>
                          
                        </>)
                      
                }
                
                <li className="nav-item">
                    <NavLink className="nav-link letras" activeClassName="active" to="/blog">Datos útiles</NavLink>
                </li>
              
                {
                    authData.user.id_usuario === null ?
                        (<>
                            <li className="nav-item">
                                <NavLink className="nav-link letras" activeClassName="active" to="/iniciar-sesion">Iniciar Sesión</NavLink>
                            </li>
                        </>) :
                        
                        (<>
                            <li className="nav-item">
                                <button
                                    type="button"
                                    className="btn btn-link nav-link letras"
                                    onClick={handleLogout}
                                >{authData.user.email}<GiExitDoor size={30}/></button>
                            </li>
                        </>)
                }
              
                
            </ul>
        </div>
    </nav>);
}

export default Nav;
